INSERT INTO lagenda_api.Balados (Id, Title, PostDatetime, UpdateDatetime, `Desc`, AppleLink, GoogleLink, SpotifyLink, BaladoCategoryId, ImageId, EpisodeNumber, Unlisted) VALUES (26, 'Leçon d''histoire ', '2020-09-28 16:33:48', '2020-09-28 16:33:49', 'Nous discutons avec l''ancien député du Bloc Québécois Paul Crête. Monsieur Crête nous raconte quelques éléments de ses mémoires de député, mais également de militant actif pour la cause indépendantiste au Québec.', 'https://podcasts.apple.com/ca/podcast/le%C3%A7on-dhistoire/id1500688101?i=1000492877874', 'https://podcasts.google.com/feed/aHR0cHM6Ly9mZWVkcy5zaW1wbGVjYXN0LmNvbS9sTmFHMHNGUw/episode/NmFhODdmMGQtNTQzNC00Njk5LWE3NTQtMjUyOWUzMGU2NDJl?sa=X&ved=2ahUKEwj6nomT2YzsAhUInnIEHdCYBI0QkfYCegQIARAF', 'https://open.spotify.com/episode/3lKOCnX3nAbdQY0vkZR5sD', 3, 83, 12, false);
INSERT INTO lagenda_api.Balados (Id, Title, PostDatetime, UpdateDatetime, `Desc`, AppleLink, GoogleLink, SpotifyLink, BaladoCategoryId, ImageId, EpisodeNumber, Unlisted) VALUES (27, 'Coup d''oeil chez les solidaires', '2020-10-05 15:34:01', '2020-10-05 15:34:03', 'On discute avec Jordan Larochelle, un fervent militant solidaire de la région de l''Outaouais. Nationalisme, parlementarisme et populisme sont au rendez-vous.', 'https://podcasts.apple.com/ca/podcast/coup-doeil-chez-les-solidaires/id1500688101?i=1000493688380', 'https://podcasts.google.com/feed/aHR0cHM6Ly9mZWVkcy5zaW1wbGVjYXN0LmNvbS9sTmFHMHNGUw/episode/ZTk5ZmFjOWQtMjg0Zi00MWQ2LWJkZDgtNjdkODBkYzAyZTkz?sa=X&ved=2ahUKEwi8sbHCmZ7sAhUJnnIEHSULCwMQkfYCegQIARAF', 'https://open.spotify.com/episode/207nmjnOhG7B12Fg1KHC9D', 1, 84, 19, false);
INSERT INTO lagenda_api.Balados (Id, Title, PostDatetime, UpdateDatetime, `Desc`, AppleLink, GoogleLink, SpotifyLink, BaladoCategoryId, ImageId, EpisodeNumber, Unlisted) VALUES (28, 'Le dernier sprint', '2020-10-08 13:57:57', '2020-10-08 13:57:58', 'Samuel discute avec Carl Vaillancourt et Vincent Boulay sur la dernière ligne droite de la course à la chefferie du Parti Québécois. Prédiction, analyse et plus encore. ', 'https://podcasts.apple.com/ca/podcast/le-dernier-sprint/id1500688101?i=1000494073517', 'https://podcasts.google.com/feed/aHR0cHM6Ly9mZWVkcy5zaW1wbGVjYXN0LmNvbS9sTmFHMHNGUw/episode/ZjZhODdmNzItMmEwYi00NjEzLWE4YjgtMGFjZDFjZTllNTg3?sa=X&ved=2ahUKEwjq5aDyyaXsAhU_gXIEHQ5YBxMQkfYCegQIARAF', 'https://open.spotify.com/episode/1CmTG5nO92MwvFABErZNt0', 1, 85, 20, false);
INSERT INTO lagenda_api.Balados (Id, Title, PostDatetime, UpdateDatetime, `Desc`, AppleLink, GoogleLink, SpotifyLink, BaladoCategoryId, ImageId, EpisodeNumber, Unlisted) VALUES (29, 'Le conservatisme et le nationalisme au Québec', '2020-10-11 12:29:21', '2020-10-11 12:29:23', 'Samuel discute avec Étienne-Alexandre Beauregard du conservatisme et du nationalisme au Québec tout en abordant l''importance de la question nationale pour la politique québécoise.', 'https://podcasts.apple.com/ca/podcast/le-conservatisme-et-le-nationalisme-au-qu%C3%A9bec/id1500688101?i=1000494361851', 'https://podcasts.google.com/feed/aHR0cHM6Ly9mZWVkcy5zaW1wbGVjYXN0LmNvbS9sTmFHMHNGUw/episode/MDY5ODlmYjYtYjQyZi00ZDliLTkzMGQtODc3Nzc1NDdkMDNm?sa=X&ved=2ahUKEwiF_s_X-6zsAhV3lXIEHdVnCY4QkfYCegQIARAF', 'https://open.spotify.com/episode/0jSXz5ChdV8j5eIfmbt6kG', 3, 86, 13, false);
