INSERT INTO lagenda_api.Balados (Id, Title, PostDatetime, UpdateDatetime, `Desc`, AppleLink, GoogleLink, SpotifyLink, BaladoCategoryId, ImageId, EpisodeNumber, Unlisted) VALUES (33, 'Cette langue qui dérange', '2020-11-23 12:07:41', '2020-11-23 12:07:42', 'Épisode lourd de sens en ces temps difficiles pour la langue française. Samuel, en compagnie d’Alec Ordon et de Carl Vaillancourt, discute de l’actualité de la semaine et des implications des différents paliers de gouvernement sur la protection de la langue mère du Canada. 
