INSERT INTO lagenda_api.Balados (Id, Title, PostDatetime, UpdateDatetime, `Desc`, AppleLink, GoogleLink, SpotifyLink, BaladoCategoryId, ImageId, EpisodeNumber, Unlisted) VALUES (36, 'Cap sur les élections', '2021-01-06 15:35:03', '2021-01-06 15:35:04', 'Jonathan, Samuel et Jérémie discutent des potentielles élections fédérales de cette année tout en faisant un retour vulgarisateur sur la politique fédérale. ', null, 'https://podcasts.google.com/feed/aHR0cHM6Ly9mZWVkcy5zaW1wbGVjYXN0LmNvbS9sTmFHMHNGUw/episode/M2YyY2NmNTAtNTY3Ni00MTA4LWIyYzgtYzQyYTQ5MzU0NzZj?sa=X&ved=0CA0QkfYCahcKEwjwy4bRk4juAhUAAAAAHQAAAAAQAQ', 'https://open.spotify.com/episode/4XqDiVgV3vtcJl99CyIvA6', 1, 100, 24, false);